import { motion } from "framer-motion";
import { Sun, Moon, Menu, X } from "lucide-react";
import { useEffect, useState } from "react";
import useTheme from "../hooks/useTheme";

const links = [
  { name: "Home", href: "#hero" },
  { name: "Skills", href: "#skills" },
  { name: "Projects", href: "#projects" },
  { name: "Work Experience", href: "#wxp" },
  { name: "Contact", href: "#contact" },
];

export default function Navbar() {
  const [activeSection, setActiveSection] = useState("hero");
  const [menuOpen, setMenuOpen] = useState(false);
  const [scrolled, setScrolled] = useState(false);
  const { theme, toggleTheme } = useTheme();

  // Active section tracking
  useEffect(() => {
    const sections = document.querySelectorAll<HTMLElement>("section[id]");
    const observer = new IntersectionObserver(
      entries => {
        entries.forEach(entry => {
          if (entry.isIntersecting) setActiveSection(entry.target.id);
        });
      },
      { rootMargin: "-50% 0px -50% 0px", threshold: 0 }
    );
    sections.forEach(section => observer.observe(section));
    return () => observer.disconnect();
  }, []);

  // Shadow on scroll
  useEffect(() => {
    const onScroll = () => setScrolled(window.scrollY > 2);
    onScroll();
    window.addEventListener("scroll", onScroll, { passive: true });
    return () => window.removeEventListener("scroll", onScroll);
  }, []);

  // Lock body scroll when mobile menu open
  useEffect(() => {
    document.body.style.overflow = menuOpen ? "hidden" : "";
    return () => {
      document.body.style.overflow = "";
    };
  }, [menuOpen]);

  const navBg = "bg-[#161b22]/95";
  const border = "border-b border-[#30363d]";
  const textBase = "text-[#8b949e]";
  const textHover = "hover:text-[#f0f6fc]";
  const textActive = "text-[#f0f6fc] font-semibold";
  const linkBase = `transition-colors ${textBase} ${textHover}`;

  return (
    <motion.nav
      initial={{ opacity: 0, y: -18 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.45 }}
      className={`fixed inset-x-0 top-0 z-50 ${navBg} backdrop-blur-md ${border} ${
        scrolled ? "shadow-[0_8px_20px_rgba(0,0,0,0.25)]" : "shadow-none"
      }`}
    >
      <div className="mx-auto max-w-6xl px-6">
        <div className="flex h-14 items-center justify-between">
          {/* Brand */}
          <a
            href="/"
            className="font-bold tracking-tight text-[#f0f6fc]"
            aria-label="MyPortfolio Home"
          >
            MyPortfolio
          </a>

          {/* Desktop links */}
          <ul className="hidden md:flex items-center gap-6">
            {links.map(link => {
              const isActive = activeSection === link.href.slice(1);
              return (
                <li key={link.href}>
                  <a
                    href={link.href}
                    className={`${linkBase} ${
                      isActive ? textActive : ""
                    } relative`}
                  >
                    {link.name}
                    {/* active underline */}
                    <span
                      className={`absolute -bottom-1 left-0 h-[2px] w-full bg-[#238636] transition-opacity ${
                        isActive ? "opacity-100" : "opacity-0"
                      }`}
                    />
                  </a>
                </li>
              );
            })}
          </ul>

          {/* Actions */}
          <div className="flex items-center gap-3">
            <button
              onClick={toggleTheme}
              aria-label="Toggle theme"
              className="p-2 rounded-full bg-[#1c2128] text-[#f0f6fc] border border-[#30363d] hover:bg-[#232a33] transition transform active:translate-y-px"
            >
              {theme === "light" ? (
                <Moon className="w-5 h-5" />
              ) : (
                <Sun className="w-5 h-5" />
              )}
            </button>

            <button
              className="md:hidden p-2 rounded-full bg-[#1c2128] text-[#f0f6fc] border border-[#30363d] hover:bg-[#232a33] transition transform active:translate-y-px"
              aria-label="Toggle menu"
              aria-expanded={menuOpen}
              onClick={() => setMenuOpen(o => !o)}
            >
              {menuOpen ? <X className="w-5 h-5" /> : <Menu className="w-5 h-5" />}
            </button>
          </div>
        </div>
      </div>

      {/* Mobile menu */}
      {menuOpen && (
        <div className="md:hidden">
          <div className="w-full bg-[#161b22] border-t border-[#30363d]">
            <ul className="flex flex-col items-center gap-3 py-4">
              {links.map(link => {
                const isActive = activeSection === link.href.slice(1);
                return (
                  <li key={link.href}>
                    <a
                      href={link.href}
                      className={`${linkBase} ${isActive ? textActive : ""}`}
                      onClick={() => setMenuOpen(false)}
                    >
                      {link.name}
                    </a>
                  </li>
                );
              })}
            </ul>
          </div>
        </div>
      )}
    </motion.nav>
  );
}
